.prizes{
    .head{
        display: flex;
        align-items: center;
        justify-content: center;
        flex-direction: column;
        .title{
            font-family: 'Brinnan';
            font-style: normal;
            font-weight: 700;
            font-size: 30px;
            letter-spacing: -0.015em;
            color: white;
        }
        .sub-title{
            width: 80%;
            margin: 0 auto;
            margin-bottom: 53px;
            font-family: "Inter";
            font-style: normal;
            font-weight: 500;
            font-size: 14px;
            line-height: 145.9%;
            text-align: center;
            letter-spacing: -0.015em;
            color: rgba(255, 255, 255, 0.8);
            margin-top: 10px;
        }
    }
    .wrap{
        max-width: 1200px;
        margin: 0 auto;
        .row{
            display: flex;
            flex-wrap: wrap;
            .cell{
                background: #633180;
                backdrop-filter: blur(9.75104px);
                border-radius: 9.75104px;
                min-width: 300px;
                height:160px;
                flex:1;
                border:0.5px solid hsla(0, 0%, 97%, 0.428);
                margin-bottom:20px;
                margin-left: 16px;
                margin-right:16px;
                display: flex;
                justify-content: center;
                align-items: center;
                .name{
                    font-family: 'Brinnan';
                    font-style: normal;
                    font-weight: 700;
                    font-size: 16px;
                    letter-spacing: -0.015em;
                    color: #FFFFFF;
                }
                .cash{
                    font-family: 'Brinnan';
                    font-style: normal;
                    font-weight: 700;
                    font-size: 40px;
                    letter-spacing: -0.015em;
                    color: #FDC506;
                }
                .cash1{
                    font-family: 'Brinnan';
                    font-style: normal;
                    font-weight: 700;
                    font-size: 40px;
                    letter-spacing: -0.015em;
                    color: #B4E32D;
                }
                .description{
                    font-family: 'Brinnan';
                    font-style: normal;
                    font-weight: 700;
                    font-size: 16px;
                    letter-spacing: -0.015em;
                    color: #FFFFFF;
                }
                .disclamer{
                    font-family: 'Brinnan';
                    font-style: normal;
                    font-weight: 700;
                    font-size: 12px;
                    letter-spacing: -0.015em;
                    color: #FFFFFF;
                }
            }
        }
    }
}
